def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    for char in prefix:
        current_line += char
        if wait_for_nl:
            if char == '\n':
                if current_line.strip() and current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]
                lines.append(current_line)
                current_line = ""
                current_column = 0
                wait_for_nl = False
        elif char == ' ':
            current_column += 1
        elif char == '\t':
            # Calculate the equivalent number of spaces for tab characters
            current_column += 4
        elif char == '\n':
            # Reset the indentation level for the new line
            current_column = 0
            if current_line.strip():
                lines.append(current_line)
            current_line = ""
            wait_for_nl = False
        else:
            # indent is finished
            wait_for_nl = True
    res = ''.join(lines)
    return res, prefix[len(res):]
